  false,\n\t\"url\": null,\n\t\"notes\": \"In March of 2010, the U.S. Geological Survey
  (USGS) conducted geophysical surveys offshore of Petit Bois Island, Mississippi,
  and Dauphin Island, Alabama. These efforts were part of the U.S. Geological Survey
  Gulf of Mexico Science Coordination partnership with the U.S. Army Corps of Engineers
  (USACE) to assist the Mississippi Coastal Improvements Program (MsCIP) and the Northern
  Gulf of Mexico (NGOM) Ecosystem Change and Hazards Susceptibility Project by mapping
  the shallow geologic stratigraphic framework of the Mississippi Barrier Island Complex.\",\n\t\"license_title\":
